import React from "react";

import {Link} from 'react-router-dom';

import AOS from 'aos';
import Isotope from 'isotope-layout'

import Container from 'react-bootstrap/Container';
import ReactNavBar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

//CSS FILES
import "../assets/vendor/aos/aos.css";
import "../assets/vendor/bootstrap/css/bootstrap.min.css";
import "../assets/vendor/bootstrap-icons/bootstrap-icons.css";
import "../assets/vendor/swiper/swiper-bundle.min.css";
import "../assets/css/style.css";

function Navbar() {

  //AOS Fading
  useEffect(() => {
    window.addEventListener('load', () => {
      AOS.init({
        duration: 1000,
        easing: 'ease-in-out',
        once: true,
        mirror: false
      })
    });
  }, [])


  //Helper Function for Filter
  const select = (el, all = false) => {
    el = el.trim()
    if (all) {
      return [...document.querySelectorAll(el)]
    } else {
      return document.querySelector(el)
    }
  }

  //Helper Function for Filter
  const on = (type, el, listener, all = false) => {
    let selectEl = select(el, all)
    if (selectEl) {
      if (all) {
        selectEl.forEach(e => e.addEventListener(type, listener))
      } else {
        selectEl.addEventListener(type, listener)
      }
    }
  }

  //Filter
  useEffect(() =>{
    window.addEventListener('load', () => {
      let portfolioContainer = select('#portfolio-grid');
      if (portfolioContainer) {
        let portfolioIsotope = new Isotope(portfolioContainer, {
          itemSelector: '.item',
        });

        let portfolioFilters = select('#filters a', true);

        on('click', '#filters a', function(e) {
          e.preventDefault();
          portfolioFilters.forEach(function(el) {
            el.classList.remove('active');
          });
          this.classList.add('active');

          portfolioIsotope.arrange({
            filter: this.getAttribute('data-filter')
          });
          portfolioIsotope.on('arrangeComplete', function() {
            AOS.refresh()
          });
        }, true);
      }
    });
  }, [])

    return (
        <>
            <div style = {{position: 'sticky'}}>


            <Container fluid = {true} style={{display:'flex', justifyContent:'flex-end'}}>
                <ReactNavBar expand="md" bg="transparent" className= "navbar-dark">
                    <ReactNavBar.Toggle className="border-0" aria-controls="navbar-toggle"/>
                    <ReactNavBar.Collapse id="navbar-toggle">
                    <Nav className="ml-auto navbar-dark">
                        <Link className="nav-link nav-custom-dark" to="/">Work</Link>
                        <Link className="nav-link nav-custom-dark" to="/">About</Link>
                        <Link className="nav-link nav-custom-dark" to="/">Resume</Link>
                    </Nav>
                    </ReactNavBar.Collapse>
                </ReactNavBar>
            </Container>
            </div>
        </>
    );
};

export default Navbar;
